            flag:this.props.countryName
        }
    }

    componentDidMount(){

        fetch('https://api.ipgeolocation.io/ipgeo?apiKey=080053faad5448749930b6bdb1ec0a7f')
        .then(response => {
            console.log(response);
            //    this.setState({
            //       name:"src"
            //      })
        }).catch(err => {
            console.log('Błąd!', err);
        });    
    }

    render(){

        return(
            <div>{this.state.flag}</div>
        )
    }
}

export default FlagsApi;
